import React from 'react';
import gapi from 'gapi-client';
import './App.css';

function App() {

    window.gapi.load('client', () => {
      console.log("1");
      gapi.client.init({
        'apiKey': 'AIzaSyBEmtcY5J8l-uaygF43hplhl_AN3FxNQVU',
        // clientId and scope are optional if auth is not required.
        'clientId': '804875693591-1a81ho73osgsmtckgbukuoi93fqlmmmd.apps.googleusercontent.com',
        'scope': 'profile',
      })
  });

  return (
    <div className="App">
    </div>
  );
}

export default App;
